export function ArrowCollapse({ visible, toggle }) {
  let returnClassAngleDown = "fa-solid fa-angle-down";
  if (!visible) {
    returnClassAngleDown += " reverse";
  }
  <i onClick={toggle} className={returnClassAngleDown}></i>;
}
